      SELECT + col1 + - col1 / 0 * 88 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 * - + CAST ( + col0 AS REAL ) * col0 * - - 39 IS NOT NULL;
  - name: tab0

outputs:
  - name: q10842.out
    data: |
